import React from "react";
import {
  Box,
  Fab,
  Grid,
  SpeedDial,
  SpeedDialAction,
  Typography,
} from "@mui/material";
import BoltIcon from "@mui/icons-material/Bolt";
import QuestionAnswerOutlinedIcon from "@mui/icons-material/QuestionAnswerOutlined";
import ChromeReaderModeOutlinedIcon from "@mui/icons-material/ChromeReaderModeOutlined";
import { FavoriteOutlined } from "@mui/icons-material";

const FloatingButton = () => {
  const [open, setOpen] = React.useState(false);
  const [icon, setIcon] = React.useState(<BoltIcon />);

  const actions = [
    {
      icon: <ChromeReaderModeOutlinedIcon sx={{ color: "indicator.orange" }} />,
      name: "Task",
    },
    {
      icon: <QuestionAnswerOutlinedIcon sx={{ color: "indicator.purple" }} />,
      name: "Chats",
    },
  ];

  // const handleClick = () => {
  //   handleClose();
  //   window.open(SocialLinks[network], '_blank');
  // };

  const handleOpen = () => {
    setOpen(true);
    setIcon(<FavoriteOutlined style={{ fill: "#d24769" }} />);
  };

  const handleClose = () => {
    setOpen(false);
    setIcon(<BoltIcon />);
  };

  return (
    // <Box
    //   position="absolute"
    //   display="flex"
    //   gap="26px"
    //   bottom={27}
    //   right={27}
    //   alignItems="flex-end"
    // >
    //   {/* <Box display="grid">
    //     <Typography color="white" variant="caption" textAlign="center">
    //       Task
    //     </Typography>
    //     <Fab aria-label="chats" sx={{ bgcolor: "white" }}>
    //       <ChromeReaderModeOutlinedIcon sx={{ color: "indicator.orange" }} />
    //     </Fab>
    //   </Box>
    //   <Box display="grid">
    //     <Typography color="white" variant="caption" textAlign="center">
    //       Inbox
    //     </Typography>
    //     <Fab aria-label="chats" sx={{ bgcolor: "white" }}>
    //       <QuestionAnswerOutlinedIcon sx={{ color: "indicator.purple" }} />
    //     </Fab>
    //   </Box>
    //   <Fab color="primary" aria-label="add">
    //     <BoltIcon />
    //   </Fab> */}

    // </Box>
    <Box position="fixed" bottom={27} right={27}>
      <SpeedDial
        direction="left"
        ariaLabel="SpeedDial tooltip example"
        position="absolute"
        icon={icon}
        onClose={handleClose}
        onOpen={handleOpen}
        open={open}
        FabProps={{
          color: "default",
          size: "small",
        }}
      >
        {actions.map((action) => (
          <SpeedDialAction
            id={action.name}
            key={action.name}
            icon={action.icon}
            tooltipTitle={action.name}
            tooltipPlacement="up"
            tooltipOpen
          />
        ))}
      </SpeedDial>
    </Box>
  );
};

export default FloatingButton;
